import React from 'react'
import { useDispatch, useSelector } from 'react-redux'

const Demo = () => {

    const dispatch = useDispatch();

    const todos = useSelector((state)=>{
        return state;
    })

    const callTodo=()=>{
        dispatch({
            type:'INCREMENT',
            payload:5
        })
    }

  return (
    <>
        <div>{todos}</div>
        <div><button onClick={callTodo}></button></div>
    </>
  )
}

export default Demo
